import './Filter.css';
import { Layout } from 'antd';
import { Checkbox } from 'antd';
import { useState, useEffect } from 'react';

const CheckboxGroup = Checkbox.Group;

function Filter() {
    const { Sider, Content } = Layout;
    const [options, setOptions] = useState([]);
    const [checkedValues, setCheckedValues] = useState([]);

    useEffect(() => {
        setOptions([
            { label: '台北', value: '台北' },
            { label: '台中', value: '台中' },
            { label: '台南', value: '台南' },
            { label: '高雄', value: '高雄' },
        ]);
    }, []);

	return (
		<div className="FilterArea">
			<div className="LocationArea">
                <Layout className="LocationArea">
                    <Sider width="5%" className="LocationArea LocationTitle">
                        <p>位置</p>
                    </Sider>
                    <Content className="LocationArea">
                        <CheckboxGroup
                            options={options}
                            value={checkedValues}
                            onChange={setCheckedValues}
                        />
                    </Content>
                </Layout>
			</div>
		</div>
	);
}

export default Filter;
